WITH filtered_dates AS (SELECT d_date_sk FROM date_dim WHERE d_month_seq BETWEEN 1193 AND 1193 + 23), filtered_catalog AS (SELECT cs_ship_date_sk, cs_warehouse_sk, cs_ship_mode_sk, cs_call_center_sk, cs_order_number, cs_item_sk FROM catalog_sales WHERE cs_list_price BETWEEN 271 AND 300) SELECT MIN(w.w_warehouse_name), MIN(sm.sm_type), MIN(cc.cc_name), MIN(cs.cs_order_number), MIN(cs.cs_item_sk) FROM filtered_catalog AS cs JOIN filtered_dates AS d ON cs.cs_ship_date_sk = d.d_date_sk JOIN warehouse AS w ON cs.cs_warehouse_sk = w.w_warehouse_sk AND w.w_gmt_offset = -5 JOIN ship_mode AS sm ON cs.cs_ship_mode_sk = sm.sm_ship_mode_sk AND sm.sm_type = 'REGULAR' JOIN call_center AS cc ON cs.cs_call_center_sk = cc.cc_call_center_sk AND cc.cc_class = 'small'